Let it go and dance it out! :)🕺🏽
@jungle4eva songs, music videos, and the dancing in them✨>>>>>>
#backon74 #jungle #shuffle

Besame Mucho was such an incredible time. 

I loved being fully immersed in a musical world completely en Español 

I loved Singing at the top of our lungs to all of our favorite songs with the fam and running into friends and seeing my DJ homies take a night off to enjoy themselves 

Also, Rubén Isaac Albarrán Ortega joining PMosh for Pervert Pop Song was epic. 

Ending the night at @barflores_la with @diego_guerrero & @eduardo.gomez.studio was the obvious choice for the nightcap. 

Happy birthday to Alex @cityofangelsbox … happy yo have been together for your first festival 

